An optional aspect module contains test cases that all relate to a common aspect of the syscall. Here "aspect" is a subjective area of related functionality. The aspect module may be either: in a single file, which contains all the test functions and the case declaration, in a folder, which contains multiple modules for the test functions and a mod.rs file, in which the case is declared. Except in the case of a very large set of test functions, the first style should be preferred. Test case Each test case exercises a minimal piece of the syscall's functionality. Each must be registered with the test_case! macro. For now, the test function takes a &mut TestContext parameter. // chmod/00.t:L58
crate::test_case!{ctime, Syscall::Chmod}
fn ctime(ctx: &mut TestContext) { for f_type in FileType::iter().filter(|ft| *ft != FileType::Symlink(None)) { let path = ctx.create(f_type).unwrap(); let ctime_before = stat(&path).unwrap().st_ctime; sleep(Duration::from_secs(1)); chmod(&path, Mode::from_bits_truncate(0o111)).unwrap(); let ctime_after = stat(&path).unwrap().st_ctime; assert!(ctime_after > ctime_before); }
}
